import Footer from "./component/Footer";
import Navbar from "./component/Navbar";
import Settings from "./component/Settings";
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div>
      <Navbar/>
      <Settings/>
      <Block1/>
      <Footer/>
    </div>
  );
}

export default App;
